import React from 'react';
import group40 from './assets/group40.png';

const Banner = () => {
  return (
    <div
      style={{
        width: '1440px',
        height: '500px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        overflow: 'hidden',
        margin: '0 auto',
        background: 'linear-gradient(90deg, #F23D31 0%, #D23429 100%)',
        position: 'relative',
      }}
    >
      {/* Group 40 overlay */}
      <img
        src={group40}
        alt="Sparkle"
        style={{
          position: 'absolute',
          top: 334,
          left: -70,
          width: 150,
          height: 150,
          opacity: 0.3,
          pointerEvents: 'none',
        }}
      />
      {/* Other banner content can go here */}
    </div>
  );
};

export default Banner;
